import React from 'react';
import { toAbsoluteUrl } from '../../_helpers/AssetsHelpers';
import Header from '../Layout/Header';
import './css/projects.scss';

function Projects(props) {
    return (
        <div className="projects_div">
            <Header />

            <div className="section_one">
                <video
                    autoPlay
                    loop
                    muted
                    // style={{
                    //     position: "relative",
                    //     width: "1440px",
                    //     left: "50%",
                    //     top: "50%",
                    //     height: "900px",
                    //     objectFit: "cover",
                    //     transform: "translate(-50%,-50%)",
                    //     // opacity: 0.5
                    //     // zIndex: "-1"
                    // }}
                >
                    <source src={toAbsoluteUrl("/media/video/video_1.mp4")} type="video/mp4"></source>
                </video>
            </div>

            <div className="section_two">
                <div className="nav_button_div">
                    <div className="left_nav_span right_nav_span">
                        <img className="left_nav_img" src={`${toAbsoluteUrl(`/media/icons/arrow-left-grey.svg`)}`} alt="Left" />
                        <span className="left_nav_label">Back to Overview</span>
                        <span className="right_nav_label">Next Project</span>
                        <img className="right_nav_img" src={`${toAbsoluteUrl(`/media/icons/arrow-right-grey.svg`)}`} alt="Right" />
                    </div>

                    <div className="title_div">
                    <span className="sub_title">Fashion Advertisement</span>
                    <span className="title">Post Production and <br></br>  Cinematic for Louis Vuitton</span>
                    </div>


                </div>

            </div>

            <div className="section_three">
                <img className="line_break" src={`${toAbsoluteUrl(`/media/icons/line.svg`)}`} alt="Image" />
            </div>

            <div className="section_four">
                <div className="row_four">
                <p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet lorem ipsum dolor etao</p>
                <p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet lorem ipsum dolor etao</p>
                </div>

            </div>

            <div className="section_five">
                <img src={`${toAbsoluteUrl(`/media/images/projects_img_1.png`)}`} alt="Image" />
                <img src={`${toAbsoluteUrl(`/media/images/projects_img_2.png`)}`} alt="Image" />
            </div>

            <div className="section_six">
                <p className="mb-0">Start today</p>
                <p className="contact_email">{process.env.REACT_APP_EMAIL}</p>
                <img className="img_right" src={`${toAbsoluteUrl('/media/icons/arrow-right.svg')}`} alt="Right" />
            </div>

            <div className="section_seven">
                <img src={`${toAbsoluteUrl('/media/icons/long-line.svg')}`} className="separatorImg" alt="Line" />
                <span>
                    <a href="" className="anchorOne">Portfolio</a>
                    <a href="" className="anchorTwo">Our Solutions</a>
                    <a href="" className="anchorThree">Our Agency</a>
                    <a href="/" className="anchorFour"><img src={`${toAbsoluteUrl('/media/images/logo_dark.svg')}`} alt={process.env.REACT_APP_NAME} /></a>
                    <a href="" className="anchorFive">Contact</a>
                    <a href="" className="anchorSix">Imprint</a>
                    <a href="" className="anchorSeven">Datasecure</a>
                </span>
            </div>
        </div>
    );
}

export default Projects;
